import React, { useState } from 'react';
import {
 Collapse,
 Navbar,
 NavbarToggler,
 NavbarBrand,
 Nav,
 NavItem,
 NavLink,
} from 'reactstrap';
import { BrowserRouter, Route, Routes, Link, useLocation } from 'react-router-dom';
import Home from './Components/Home';
import Booklet from './Components/Booklet';
import Doctor from './Components/Doctor';
import Roster from './Components/Roster';
import Login from './Login';
import NavbarComponent from './NavBarComponent.js'; // Import your NavbarComponent

function App() {
 const [isOpen, setIsOpen] = useState(false);
 const toggle = () => setIsOpen(!isOpen);

 return (
 <BrowserRouter>
    <div>
      <NavbarComponent toggle={toggle} isOpen={isOpen} />
      <Routes>
        <Route path='/components/home' element={<Home />} />
        <Route path='/components/booklet' element={<Booklet />} />
        <Route path='/components/doctor' element={<Doctor />} />
        <Route path='/components/roster' element={<Roster />} />
        <Route path='/stcomponents/home' element={<Home />} />
        <Route path='/stcomponents/booklet' element={<Booklet />} />
        <Route path='/stcomponents/doctor' element={<Doctor />} />
        <Route path='/stcomponents/roster' element={<Roster />} />
        <Route path='/' element={<Login />} />
      </Routes>
    </div>
 </BrowserRouter>
 );
}

export default App;
